INSERT INTO `cluster_metadata` (`cluster_id`, `cluster_name`, `description`, `avg_age`, `avg_income`, `avg_purchase_amount`, `customer_count`, `age_min`, `age_max`, `income_min`, `income_max`, `purchase_min`, `purchase_max`, `dominant_gender`, `dominant_region`, `business_recommendation`, `last_updated`) VALUES
(0, 'Affluent Senior Premium', 'This segment consists of 2,218 customers characterized by senior demographics (avg age 63.9), affluent income levels (avg $54,371), and premium spending behavior (avg $3,952 per purchase).', 63.85, 54371.28, 3952.09, 2218, 40, 78, 10027.70, 99872.63, 2272.31, 4999.63, 'Other', 'Region VIII', 'Emphasize ease of use, reliability, and customer support; Provide clear documentation and instructional content; Offer phone-based customer service and personal assistance; Focus on products that enhance comfort and convenience', '2026-01-06 05:55:57'),
(1, 'High-Income Mature Moderate', 'This segment consists of 2,155 customers characterized by mature demographics (avg age 49.5), high-income income levels (avg $79,074), and moderate spending behavior (avg $1,514 per purchase).', 49.45, 79073.52, 1513.50, 2155, 18, 78, 46474.52, 99969.48, 500.77, 3345.96, 'Male', 'NCR', 'Identify barriers to purchase and address them through targeted campaigns; Introduce mid-tier to premium product lines to match income level; Provide educational content about product value propositions; Test promotional offers to convert high-income browsers to buyers', '2026-01-06 05:55:57'),
(2, 'Mid-Tier Senior Moderate', 'This segment consists of 1,734 customers characterized by senior demographics (avg age 61.4), mid-tier income levels (avg $32,692), and moderate spending behavior (avg $1,694 per purchase).', 61.40, 32692.40, 1694.08, 1734, 36, 78, 10029.33, 66984.42, 502.70, 3509.44, 'Other', 'Region X', 'Emphasize ease of use, reliability, and customer support; Provide clear documentation and instructional content; Offer phone-based customer service and personal assistance; Focus on products that enhance comfort and convenience', '2026-01-06 05:55:57'),
(3, 'Mid-Tier Middle-Aged Active', 'This segment consists of 2,211 customers characterized by middle-aged demographics (avg age 31.0), mid-tier income levels (avg $31,941), and active spending behavior (avg $2,810 per purchase).', 30.97, 31941.44, 2809.55, 2211, 18, 54, 10002.14, 65883.62, 500.53, 4999.16, 'Other', 'Region VII', 'Focus on value proposition and quality messaging; Offer family-oriented products and bundled solutions; Implement email marketing with personalized recommendations; Provide loyalty rewards that accumulate over time', '2026-01-06 05:55:57'),
(4, 'High-Income Middle-Aged Premium', 'This segment consists of 1,682 customers characterized by middle-aged demographics (avg age 33.9), high-income income levels (avg $78,522), and premium spending behavior (avg $3,725 per purchase).', 33.88, 78521.66, 3725.44, 1682, 18, 60, 41980.32, 99974.73, 1807.32, 4999.17, 'Male', 'CAR', 'Target with premium product offerings and exclusive services; Implement VIP loyalty program with personalized benefits; Focus on high-touch customer service and relationship building; Offer premium financing options and extended warranties', '2026-01-06 05:55:57');
